import React, { Component } from "react";
import "./Home.css";
import "../FormElements/FormElements.css";
import "../Font/Font.css";
import uYtitle from "../Images/uYtitle.png";
import snowyOwl from "../Images/snowyOwl.GIF";


import { AmplifyAuthenticator, AmplifySignOut, AmplifySignIn, AmplifySignUp, AmplifyGreetings, AmplifyConfirmSignUp} from '@aws-amplify/ui-react';




class SignIn extends Component {
  render() {



    const signIn = () => (
      <AmplifyAuthenticator>
      <div>
       <AmplifySignOut />
      </div>
    </AmplifyAuthenticator>

    );






    return (
      <div className= "home">
        <div className= "home">
          <img className= "uYtitle" src={uYtitle} alt="ultraYumm logo" />
          <h1 className= "black montebello title">
            Get more energy!<span>&nbsp;&nbsp;</span>
            <span className="lighter">pack lighter{signIn()}</span>
          </h1>
          <div className="snowyOwlcontainer"><img className="snowyOwl" src={snowyOwl} alt="snowy owl gif" /></div>

        </div>


      </div>
    );
  }
}
export default SingIn;
